.eqv BASE_ADDRESS 0x10008000
.eqv END_ADDRESS 0x10008ffc
.eqv END_PIXEL 16384
.eqv WIDTH 4 # Width of an integer
.eqv PERROW 64
.eqv SLEEP 40

.text
li $t0, BASE_ADDRESS	# stores the base address for display
li $s0, 0x000000	# stores the black colour code
li $s1, 0		# Binary Check for coins
li $s2, 0x71b415	# stores the green colour code
li $s3, 0x4a72e9	# stores the blue colour code
li $s4, 0xffd028	# stores the yellow colour code
li $s5, 0xffffff	# stores colour code for colour arrays (white by default)
li $s6, 1		# Binary Check 
li $s7, 2		# Which level player is in

li $t1, 0		# Counter
li $t2, 0		# Keypress
li $t3, 0		# current position address
move $t4, $t0		# temporary register for base address
li $t5, 15		# starting X position
li $t6, 47		# starting Y position
la $t7, wincolour	# Register for temporary array of colours

main:
	li $t9, 0xffff0000 # hex code for keyboard

	menu:
		# Display Main Menu on BitMap Display
		lw $s5, 0($t7)
		sw $s5, 0($t4)
		addi $t7, $t7, 4
		addi $t4, $t4, WIDTH
		addi $t1, $t1, WIDTH
		blt $t1, END_PIXEL, menu
		j continue
	
	continue:
		lw $t8, 0($t9)
		beq $t8, 1, keypress_happened

	keypress_happened:
		# Sleep Time
		li $v0, 32
		li $a0, SLEEP # Wait
		syscall
		# Reset Base Address and Counter
		move $t4, $t0
		li $t1, 0
		#Keyboard Operatrions
		lw $t2, 4($t9) 			# this assumes $t9 is set to 0xfff0000 from before
		beq $t2, 0x65, END 		# Hex code of 'e' is 0x65, set to exit and call $v0 10
		beq $t2, 0x71, quit 		# Hex code of 'q' is 0x71, set to quit
		beq $t2, 0x72, restart 		# Hex code of 'r' is 0x72, set to restart
		beq $t2, 0x73, restart 		# Hex code of 's' is 0x73, set to restart
		beq $t2, 0x61, move_left 	# Hex code of 'a' is 0x61, set to move left
		beq $t2, 0x64, move_right 	# Hex code of 's' is 0x64, set to move right
		beq $t2, 0x77, jump 		# Hex code of 'w' is 0x77, set to jump
		j keypress_happened
	
	restart:
		jal game
		j keypress_happened
	
	quit:
		# Quit to Main Menu
		# Display Main Menu on BitMap Display
		la $t7, menucolour # set $t7 to address of menucolour
		quitloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, quitloop
		j keypress_happened
			
	gameover:
		# Game Over Screen
		la $t7, gameovercolour # set $t7 to address of menucolour
		overloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, overloop
		j keypress_happened
		
	youwin:
		# Win Screen
		la $t7, wincolour # set $t7 to address of menucolour
		winloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, winloop
		j keypress_happened

game:
	
	startpos:
		li $t8, 1
		beq $s7, $t8, ONE
		li $t8, 2
		beq $s7, $t8, TWO
		li $t8, 3
		beq $s7, $t8, THREE
		
		ONE:
			# Different Starts for different levels
			li $t5, 15
			li $t6, 47
			j calcpos
		TWO:
			# Different Starts for different levels
			li $t5, 15
			li $t6, 51
			j calcpos
		THREE:
			# Different Starts for different levels
			li $t5, 32
			li $t6, 50
			j calcpos
		
	calcpos:
		bltz $t5, resetleft
		bltz $t6, restart
		bgt $t5, 61, resetright
		bgt $t6, PERROW, gameover
		# adress(x,y) = address(t5,t6) = (t6 * PERROW + t5)*4
		li $t8, PERROW
		mult $t8, $t6
		mflo $t3
		add $t3, $t3, $t5
		li $t8, WIDTH
		mult $t3, $t8
		mflo $t3
	
	
	# Display Level 1 Stage on BitMap Display
	stage:
		li $t8, 1
		beq $s7, $t8, BGONE
		li $t8, 2
		beq $s7, $t8, BGTWO
		li $t8, 3
		beq $s7, $t8, BGTHREE
		
		BGONE:
			la $t7, level1
			j stageloop
		BGTWO:
			la $t7, level2
			j stageloop
		BGTHREE:
			la $t7, level3
			j stageloop
		
		stageloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, stageloop
		j character
	
	character:
		move $t4, $t0
		add $t4, $t4, $t3
		li $s6, 1
		
		sw $s0, 0($t4)
		addi $t4, $t4, 4
		sw $s0, 0($t4)
		addi $t4, $t4, 4
		li $s0, 0xdb0c29
		sw $s0, 0($t4)
		addi $t4, $t4, 256
		li $s0, 0x000000
		sw $s0, 0($t4)
		subi $t4, $t4, 4
		sw $s0, 0($t4)
		subi $t4, $t4, 4
		sw $s0, 0($t4)
		addi $t4, $t4, 260
		sw $s0, 0($t4)

		j continue
	
	cover:
		move $t4, $t0
		add $t4, $t4, $t3
		
		sw $s3, 0($t4)
		addi $t4, $t4, 4
		sw $s3, 0($t4)
		addi $t4, $t4, 4
		sw $s3, 0($t4)
		addi $t4, $t4, 256
		sw $s3, 0($t4)
		subi $t4, $t4, 4
		sw $s3, 0($t4)
		subi $t4, $t4, 4
		sw $s3, 0($t4)
		addi $t4, $t4, 260
		sw $s3, 0($t4)
		li $s6, 0
		addi $t4, $t4, 256
	
	move_left:
		subi $t5, $t5, 1
    		j calcpos
	
	move_right:
		addi $t5, $t5, 1
    		j calcpos
    	
    	jump:
		subi $t6, $t6, 1
		subi $t6, $t6, 1
		subi $t6, $t6, 1
		subi $t6, $t6, 1
    		j calcpos
    		
    	move_down:
		addi $t6, $t6, 1
    		j calcpos
    		
    	resetleft:
    		li $t5, 0
    		j calcpos
    	
    	resetright:
    		li $t5, 61
    		j calcpos

END:
	# Display Black Screen on BitMap Display
	sw $s0, 0($t4)
	addi $t4, $t4, WIDTH
	addi $t1, $t1, WIDTH
	blt $t1, END_PIXEL, END

	li $v0, 4
	la $a0, result
	syscall
		
	li $v0, 10 # terminate the program gracefully
	syscall

